import React from 'react'
import ReactDOM from 'react-dom'

// Teht채v채 2.1 - A separate phonebook component

const Header = (props) => {
  return (
    <h1>
      <p>{props.title}</p>
    </h1>
  )
}

const Entry = (props) => {  

  return(
    <div>
      <p>{props.name} {props.phone}</p>      
    </div>
  )
}

const Contents = (props) => {

  return (
    <div>
      <Entry name = {props.contacts[0].name} phone = {props.contacts[0].phonenumber} />
      <Entry name = {props.contacts[1].name} phone = {props.contacts[1].phonenumber} />
      <Entry name = {props.contacts[2].name} phone = {props.contacts[2].phonenumber} />
    </div>
  )
}

const Phonebook = ({phonebook}) => {

  return (
    <div>
      <Header title = 'Superadvanced phonebook app'></Header>


    </div>


  )

}

const App = () => {
  const phonebook = {
    name: 'Superadvanced phonebook app',
    contacts: [
      {
        name: 'John Doe',
        phonenumber: '358401234567',
        id: 1
      },
      {
        name: 'Jane Doe',
        phonenumber: '44551234567',
        id: 2
      },
      {
        name: 'Foo bar',
        phonenumber: '000',
        id: 3
      }
    ]
  }

  return (
    <div>
      <Phonebook phonebook={phonebook} />
    </div>
  )
}


ReactDOM.render(
  <App />,
  document.getElementById('root')
)
